import React from "react";
import { Svg, Image, Defs, Use, Rect, Pattern } from "react-native-svg";

export const ServiceIcone = ({ size, colorMode }) => {
  return (
    <Svg
      version="1.2"
      baseProfile="tiny-ps"
      xmlns="http://www.w3.org/2000/svg"
      viewBox={`0 0 ${size} ${size}`}
      width={size}
      height={size}
    >
      <Defs>
        <Image
          width={size}
          height={size}
          id="img1"
          href={`data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAgAAAAIAAQMAAADOtka5AAAAAXNSR0IB2cksfwAAAAZQTFRFAAAA${
            colorMode === "dark" ? "////pdmf3Q" : "AAAApWe5zw"
          }`}
        />
      </Defs>
      <Use id="Layer 1" href="#img1" x="0" y="0" />
    </Svg>
  );
};

